import React, { Component } from "react";
import SHOP_DATA from "./shop.data";

export default class ShopPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      collection: SHOP_DATA
    };
  }
  render() {
    return <div>SHOP_DATA</div>;
  }
}
